/**
 * Default Company Logos
 * Embedded logos for PartnerCo and SAP that are available to all projects
 */

// Partner Consulting Logo
export const PARTNER_LOGO = "data:image/png;base64,";

// SAP Logo
export const SAP_LOGO = "data:image/png;base64,";

/**
 * Default company logos map
 * These logos are available to all projects by default
 */
export const DEFAULT_COMPANY_LOGOS: Record<string, string> = {
  "Partner Consulting": PARTNER_LOGO,
  "PartnerCo": PARTNER_LOGO,
  "SAP": SAP_LOGO,
  "SAP SE": SAP_LOGO,
};

/**
 * Get company logo URL - checks custom uploads first, then defaults
 */
export function getCompanyLogoUrl(
  companyName: string,
  customLogos?: Record<string, string>
): string | undefined {
  // Check custom uploaded logos first
  if (customLogos && customLogos[companyName]) {
    return customLogos[companyName];
  }

  // Check default logos
  return DEFAULT_COMPANY_LOGOS[companyName];
}

/**
 * Get all available company logo options (defaults + custom)
 */
export function getAllCompanyLogos(customLogos?: Record<string, string>): Record<string, string> {
  return {
    ...DEFAULT_COMPANY_LOGOS,
    ...(customLogos || {}),
  };
}
